import React from 'react';
import '../../App.css';
import Footer from '../Footer';
import TemplateAlbum from '../TemplateAlbum';

export default function Templates() {
    return(
        <>
            <h1 className='templates'>TEMPLATES</h1>
            <TemplateAlbum />
            <Footer />
        </>
    )
}
